    <Container>
      <ContainerSemana>
        <Semanas>
          <TileSemana>Domingo</TileSemana>
          <Data>
            <ContainerData> 
              <ul>
              <p>Nome</p>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </ContainerData>
            <ContainerData> 
              <ul>
              <p>Birthdate</p>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </ContainerData>
          </Data>
