          <TileSemana>Segunda-feira
          </TileSemana>
          <Data>
            <ContainerData> 
              <ul>
              <p>Nome</p>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </ContainerData>
            <ContainerData> 
              <ul>
              <p>Birthdate</p>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </ContainerData>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Treça-feira</TileSemana>
          <Data>
            <ContainerData> 
              <ul>
                <p>Nome</p>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </ContainerData>
            <ContainerData> <p>Birthdate</p>
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </ContainerData>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Quarta-feira</TileSemana>
          <Data>
            <ContainerData> <p>Nome</p>
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </ContainerData>
            <ContainerData> <p>Birthdate</p>
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </ContainerData>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Quinta-feira</TileSemana>
